import { useSelector } from "react-redux"


export const SearchFilter = (event, searchdata) => {
    // const searchdata = useSelector((state) => state.array2)
    return (dispatch) => {
        const ValueStore = []
        for (let i = 0; i >= searchdata.length; i++)
            for (let n in i) {
                if (event === searchdata[n]) {
                    ValueStore.push(searchdata[n])
                }
            }
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
